import React, { Component } from "react";

class GenerateStats extends Component {
  constructor() {
    super();
    this.state = {
      loading: true,
      stats: {},
    };
  }

  componentDidMount() {
    this.setState({ loading: false });
    fetch(
      "https://call-of-duty-modern-warfare.p.rapidapi.com/warzone/reubsz92/psn",
      {
        method: "GET",
        headers: {
          "x-rapidapi-host": "call-of-duty-modern-warfare.p.rapidapi.com",
          "x-rapidapi-key":
            "afbd007707mshf3e391b451ab77cp1daa16jsn8b3241a3e170",
        },
      }
    )
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        this.setState({
          stats: data,
        });
      });
  }
  render() {
    if (this.state.loading) {
      return <div>Loading...</div>;
    } else
      return (
        <div>
          <p>Word</p>
        </div>
      );
  }
}

export default GenerateStats;
